import React from 'react';
import Layout from '../../layout/Layout/Layout';
import styles from './News.module.scss';
const News =  () =>{
    return(
        <Layout className={styles.container}>
            <h2>Tin tức</h2>
            <p>Cập nhật tin tức hàng tuần với G-STORE</p>
        </Layout>
    )
}

export default News;
